
DROP TABLE IF EXISTS poi;


CREATE TABLE poi (
    id integer NOT NULL,
    geom geometry(Point,27700),
    reference bigint,
    name character varying(254),
    pointxclass character varying(254),
    address character varying(254),
    streetname character varying(254),
    locality character varying(254),
    geographic character varying(254),
    postcode character varying(254),
    administra character varying(254),
    url character varying(254),
    brand character varying(254),
    provenance character varying(254),
    dateofsurvey character varying(254)
);






CREATE INDEX sidx_f21dfexame_poi_geom ON poi USING gist (geom);
